"""La Tasa de Conversi칩n es mucho m치s baja para los idiomas ingl칠s y espa침ol, mientras que los idiomas alem치n y 치rabe cuentan con las tasas mas altas.

* Se llevar치n a cabo una serie de funciones para facilitar y agilizar los futuros an치lisis.
"""

# Se crea una funci칩n de Tasa de Conversi칩n en la cual se pasan un dataframe y una lista de nombres de columnas:
def conversion_rate(dataframe, column_names):
    # Se agrupa por column_names y se calcula la conversi칩n:
    column_conv = dataframe[dataframe["converted"] == True]\
                       .groupby(column_names)["user_id"].nunique()

    # Se calcula el total de personas:
    column_total = dataframe.groupby(column_names)["user_id"].nunique()   
    
    # Se calcula la Tasa de Conversi칩n:
    conversion_rate = column_conv/column_total
    
    # Se convierten los valores nulos en 0:
    conversion_rate = conversion_rate.fillna(0)
    return conversion_rate

"""* Utilizando la funci칩n antes creada, se determinar치 la Tasa de Conversi칩n por fecha en que se observ칩 el anuncio y por grupo etario, pasando estas columnas como una lista de string."""

# Se calcula la Tasa de Conversi칩n diaria por grupo etario:
age_group_conv = conversion_rate(marketing, ['date_served',
                                             'age_group'])
age_group_df = pd.DataFrame(age_group_conv.unstack(level = 1))
