"""De este modo se puede visualizar la Tasa de Conversi칩n por grupo etario de manera mas detallada."""

# Se crea una funci칩n de Tasa de Retenci칩n en la cual se ingresa un dataframe y una lista de nombres de columnas:
def retention_rate(dataframe, column_names):
    # Se agrupa por column_names y se calcula la retenci칩n:
    retained = dataframe[dataframe["is_retained"] == True]\
                       .groupby(column_names)["user_id"].nunique()

    # Se agrupa por column_names y se calcula la conversi칩n:
    converted = dataframe[dataframe["converted"] == True]\
                       .groupby(column_names)["user_id"].nunique() 
    
    # Se calcula la Tasa de Retenci칩n:
    retention_rate = retained/converted 
    return retention_rate

"""* A continuaci칩n se calcula, utilizando la funci칩n antes creada, la Tasa de Retenci칩n por canal de marketing y fecha de suscripci칩n, pasando estas columnas como una lista de string. """

# Se calcula la Tasa de Retenci칩n diaria por tipo de canal:
daily_retention = retention_rate(marketing, ["date_subscribed", "subscribing_channel"])
daily_retention = pd.DataFrame(daily_retention.unstack(level=1))
daily_retention.head()

# Se realiza un gr치fico de l칤neas de la Tasa de Retenci칩n antes calculada:
daily_retention.plot(figsize=(7,7))
plt.title("Tasa de Retenci칩n diaria por Canal de Marketing", size = 15)
plt.ylabel("Tasa de Retenci칩n (%)", size = 14)
