plt.show()

"""Al igual que con la Tasa de Conversi칩n por grupo etario, se dificulta ver el gr치fico de Tasa de Retenci칩n por lo que se har치 un gr치fico individual para cada canal de marketing a trav칠s de una funci칩n de gr치fico."""

# Se establece la funci칩n del gr치fico que toma como argumento un dataframe:
# A trav칠s de un bucle for se recorre cada columna del dataframe y se grafica cada una individualmente:
def plotting(dataframe):
    for column in dataframe:
        # En el eje x se coloca el 칤ndice de cada columna para mostras las fechas, mientras que los valores de las columnas van en el eje y:
        plt.plot(dataframe.index, dataframe[column])
        plt.title("Tasa de Retenci칩n  " + str(column),
                  size = 15)
        plt.ylabel("Tasa de Retenci칩n (%)", size = 14)
        plt.xticks(rotation=45)      
        plt.show()

# Se realiza el gr치fico:
plotting(daily_retention)

"""Se observa un gr치fico para cada canal de marketing (columna del dataframe creado) por fecha. El gr치fico del correo electr칩nico tiene grandes picos que a menudo bajan a 0. Esto es com칰n porque los correos electr칩nicos generalmente se env칤an en masa, lo que lleva a los usuarios a suscribirse en el mismo conjunto de d칤as limitados. Cuando la tasa de retenci칩n es 0, esto significa que nadie se suscribi칩 en esos d칤as.

* Ahora se tratar치 de encontrar la causa de la disminuci칩n repentina de la tasa de conversi칩n observada en los anuncios internos.
"""

# Se calcula la Tasa de Conversi칩n por fecha y canal:
