"""En base al an치lisis realizado se concluye en que la ca칤da en la tasa de conversi칩n de los anuncios internos a partir del d칤a 11 de enero se debe a que los mismos fueron visualizados solo en ingl칠s en lugar del idioma preferido de cada usuario.

* Ahora se evaluar치 que impacto tuvo la ca칤da en la tasa de conversi칩n debido al problema en la visualizaci칩n de los anuncios, estimando cual hubiera sido la tasa de conversi칩n si no hubiera existido el problema. 
 
 Una forma de evaluar el impacto es indexar las tasas de conversi칩n de todos los dem치s idiomas al ingl칠s durante el per칤odo en que los anuncios se publicaron en el idioma correcto para cada usuario.

 Se comienza cortando el marco de datos house_ads para incluir las filas donde la fecha de servicio es anterior a cuando surgi칩 el error de idioma. Usando la funci칩n conversion_rate(), se calcula la tasa de conversi칩n para cada idioma durante ese per칤odo:
"""

# Se calcula la tasa de conversi칩n previo a la fecha cuando comenz칩 el error:
house_ads_no_bug = house_ads[house_ads["date_served"] < "2018-01-11"]
lang_conv = conversion_rate(house_ads_no_bug, ["language_displayed"])
lang_conv

"""* Se divide la tasa de conversi칩n de todos los demas idiomas por la tasa de conversi칩n del ingl칠s para comprender la relaci칩n relativa de que tan bien los anuncios internos suelen convertir a los usuarios de cada idioma en comparaci칩n al ingl칠s:"""

# Se indexa la tasa de conversi칩n de otros idiomas contra el ingl칠s:
spanish_index = lang_conv["Spanish"]/lang_conv["English"]
arabic_index = lang_conv["Arabic"]/lang_conv["English"]
german_index = lang_conv['German']/lang_conv["English"]
print("Indice Espa침ol:", spanish_index)
print("Indice Arabe:", arabic_index)
print("Indice Aleman:", german_index)

"""* De acuerdo a los resultados de los 칤ndices se observa que los usuarios de habla hispana suelen convertir 1,7 veces m치s que los angloparlantes, mientras que los hablantes alemanes y 치rabes convierten entre 4 y 5 veces m치s.
 
 A continuaci칩n se calcula el n칰mero total de usuarios por d칤a en base al idioma preferido y las conversiones reales de cada d칤a:
"""

# Se agrupa house_ads por fecha e idioma preferido:
# Se usa el m칠todo .agg() ya que se quieren calcular dos valores.
# Se pasa un diccionario al m칠todo donde la clave es el nombre de la columna y el valor es la operaci칩n que se quiere calcular:
language_conversion = house_ads.groupby(["date_served", 
                          "language_preferred"])\
                        .agg({"user_id":"nunique",
                              "converted":"sum"})

# Se crea el dataframe:
converted_df = pd.DataFrame(language_conversion.unstack(level=1))
converted_df.head(12)

"""El resultado es un dataframe con la cantidad de usaurios que deber칤an haber visto anuncios en cada idioma y cuantos de esos usuarios se convirtieron cada d칤a.

* Se calcula la tasa de conversi칩n del idioma ingl칠s para el periodo de error:
"""

# Se calcula la tasa de conversi칩n en el idioma ingl칠s para el periodo de error:
converted_df["actual_english_conversions"] = converted_df.loc["2018-01-11":"2018-01-31"][("converted","English")]
converted_df.head(12)

"""* Luego se multiplica la tasa de conversi칩n de ingl칠s real durante el periodo por los 칤ndices de idiomas que se crearon anteriormente, para determinar cuales habr칤an sido las tasas de conversi칩n esperadas para estos idiomas para cada d칤a:"""

# Se calculan las tasas de conversi칩n esperadas para cada idioma:
converted_df["expected_spanish_rate"] = converted_df["actual_english_conversions"]*spanish_index
converted_df["expected_arabic_rate"] = converted_df["actual_english_conversions"]*arabic_index
converted_df["expected_german_rate"] = converted_df["actual_english_conversions"]*german_index

"""* Ahora se  multiplica la tasa de conversi칩n diaria esperada de cada idioma por la cantidad de usuarios que deber칤an haber visto anuncios en ese idioma. Esto  da como resultado cu치ntos suscriptores se habr칤an esperado si no hubiera ocurrido el error de idioma:"""

# Se multiplica el n칰mero de usuarios por la tasa de conversi칩n esperada
converted_df["expected_spanish_conv"] = converted_df["expected_spanish_rate"]/100*converted_df[("user_id","Spanish")]
converted_df["expected_arabic_conv"] = converted_df["expected_arabic_rate"]/100*converted_df[("user_id","Arabic")]
converted_df["expected_german_conv"] = converted_df["expected_german_rate"]/100*converted_df[("user_id","German")]

"""* Por 칰ltimo se determina el n칰mero de suscriptores perdidos en el periodo de error. Para esto se toma la diferencia en la cantidad de suscriptores que se esperaban y la cantidad de suscriptores que se recibieron, lo que da una estimaci칩n de cu치ntos suscriptores se perdieron debido al error de idioma."""

# En primer lugar se limita el dataframe al periodo de an치lisis
converted = converted_df["2018-01-11":"2018-01-31"]
# Luego se suman el n췈 de suscriptores esperados y los reales en el periodo:
expected_subs = converted["expected_spanish_rate"].sum() + converted["expected_arabic_rate"].sum() + converted["expected_german_rate"].sum()
# Se calcula cuantos suscriptores hay realmente:
actual_subs = converted[("converted","Spanish")].sum() + converted[("converted","Arabic")].sum() + converted[("converted","German")].sum()
# Finalmente se calcula la diferencia entre los  suscriptores que se esperaban y los suscriptores que se recibieron, lo que da cuantos suscriptores se perdieron
lost_subs = expected_subs - actual_subs
lost_subs

